import styled from "@emotion/styled";
import { useState } from "react";
import { CardContentT } from "../typesTS/CardContent";

// import styled from "@emotion/styled/macro";

export default function SmallCard({ card }: { card: CardContentT }) {
  // styles

  const Container = styled.div`
    margin-top: 50px;
    margin-left: 150px;
    display: grid;
    width: 278px;
    grid-template-rows: 55px 50px;
    grid-template-columns: 84px 194px;
    background-color: #fff;
  `;
  const CardPic = styled.img`
    grid-column-start: 1;
    grid-column-end: 2;
    grid-row-start: 1;
    grid-row-end: 3;
  `;
  // functionality
  return (
    <Container>
      <CardPic src={card.picAdress}></CardPic>
    </Container>
  );
}
